class Solution(object):
    def characterReplacement(self, s, k):
        """
        :type s: str
        :type k: int
        :rtype: int
        """
        i = 0
        j = 1
        n = len(s)
        segments = []
        while j < n:
            if s[j] != s[j-1]:
                segments.append([j-i,s[j-1]])
                i = j
            j += 1
        segments.append([j-i,s[j-1]])
        ns = len(segments)
        records = [0 for i in range(26)]
        i = 0
        j = 0
        answer = 0
        max_value = 0
        max_point = None
        summation = 0
        segments = segments[::-1]
        while j < ns:
            index = ord(segments[j][1]) - 65
            records[index] += segments[j][0]
            summation += segments[j][0]
            if records[index] >= max_value:
                max_point = index
                max_value = records[index]
            while summation-max_value > k:
                delete = ord(segments[i][1])-65
                records[delete] -= segments[i][0]
                summation -= segments[i][0]
                if delete == max_point:
                    max_value = max(records)
                    max_point = records.index(max_value)
                i += 1
            if summation > answer:
                answer = summation
                max_j = j
                max_i = i
            j += 1
        print(j)
        print(ns)
        return answer, sum([a[0] for a in segments[0:max_i-1]]), sum([a[0] for a in segments[0:max_j-1]])



solution = Solution()
print(solution.characterReplacement("",756))
